import React, {Component} from 'react';
import { connect } from 'react-redux';
import * as actionTypes from '../../../store/actions';
import LandingNavbar from '../../LandingPage/LandingNavbar/LandingNavbar';
import AboutPage1 from '../../LandingPage/About/AboutPage1';
import AboutPage2 from '../../LandingPage/About/AboutPage2';
import LandingHome from '../../LandingPage/LandingHome/LandingHome';
import Contact from '../../LandingPage/Contact/Contact';
import LoginModal from '../../Common/LoginModal/LoginModal';
import RegisteredEvents from '../../Home/RegisteredEvents/RegisteredEvents';

class LandingLayout extends Component {
    state = {
        loggingIn: false,
        onLanding: true
    }

    loginHandler = () => {
        this.setState({loggingIn: !this.state.loggingIn});
    }

    render() {
        return (
            <div>
                <LandingNavbar 
                    loggingIn={this.loginHandler}/>
                <LoginModal 
                    loggingIn={this.loginHandler}
                    show={this.state.loggingIn}/>

                { this.state.onLanding ?
                    <div>
                        <LandingHome />
                        <AboutPage1 />
                        <AboutPage2 />
                        <Contact /> 
                    </div> : 
                    <div>
                        <RegisteredEvents />
                    </div>
                }
            </div>
        );
    }
}

const mapStateToProps = state => {
    return {

    };
}

const mapDispatchToProps = dispatch => {
    return {

    };
}

export default connect(mapStateToProps, mapDispatchToProps)(LandingLayout);
